import './App.css';
import 'leaflet/dist/leaflet.css';
import { MapContainer, TileLayer, Marker, Popup, useMapEvents } from 'react-leaflet'
import L from 'leaflet';

function App() {
  useMapEvents({click: (e)=>{console.log(e)}})
  return (
    <div className="App">
      <MapContainer center={[51.505, -0.09]} zoom={10} scrollWheelZoom={false} doubleClickZoom={false} click={(e)=>{console.log(e)}}>
        <TileLayer
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />
        <Marker position={[51.505, -0.09]} icon={new L.Icon({
          iconUrl: require('./logo192.png'),
          iconAnchor: null,
          popupAnchor: [0,0],
          shadowUrl: null,
          shadowSize: null,
          shadowAnchor: null,
          iconSize: new L.Point(20, 20),
          className: 'leaflet-div-icon'
        })}>
          <Popup>
            A pretty CSS3 popup. <br /> Easily customizable.
          </Popup>
        </Marker>
      </MapContainer>
    </div>
  );
}

export default App;
